import React, { Component } from 'react'
import Users from "./audiImgs/cars.json";



export class Audi extends Component {



    // componentDidMount() {
    //     fetch('audiImgs/cars.json')
    //         .then(function(resp){
    //             return resp.json();
    //         })
    //         .then(function(data){
    //             console.log(data);
    //         })
    // }

    render() {

        return (
            <div className="container">
                <h1>Users list</h1>
                {Users.map(user => (
                    <li key={user.name}>{user.name}</li>
                ))}
            </div>
        )
    }
}

export default Audi
